import React, { Component } from "react";
import CoverPage from '../assets/coverpage.png';

class Image extends Component {
	render() {
		const myStyle = {
			backgroundImage: `url(${CoverPage})`,
			height: "100vh",
			marginTop: "110px",
			fontSize: "10px",
			marginLeft: "300px",
			width: "1900px",
			backgroundRepeat: "no-repeat",
		};

		const headingStyle = {
			margin: "0",
			padding: "20px",
			textAlign: "center", // Aligns the text to the left
			color: "#000",     // Adjust color if needed
		};

		return (
			<div style={myStyle}>	
				<h1 style={headingStyle}>IT PROFESSIONAL</h1>
			</div>
		);
	}
}

export default Image;
